const UserList = () => {
  const users = useSelector(state => state.users)
  //const numberBlogs = users.blogs.length
  return(
    <div>
      <h2>Users</h2>

      {users.map(user =>
        <li key={user.id}>
          {user.name} {user.blogs}
        </li>)}
    </div>
  )
}

export default UserList
